    {[...fbList.map(child=><Item payload={{content:`URL:${child.url} Created At:${child.createdAt}`}}>{child.name}</Item>),<Detail>{(payload) => payload.content}</Detail>].map(child=>child)}
  </MasterDetail>

  return <div>Loading....</div>
};
